This is a well-done book that covers the tough topics and issues of immigration, refugees, and racism. The book holds a lot of substance and it’s not hard or dense to read because of its language or with the excessive use of tragedy that wouldn't bring anything more to the story. 

Written in three POVs, Mahindan, a refugee, his lawyer, Priya, who reluctantly represents immigrants, and Grace a Japanese-Canadian Adjudicator who must decide Mahindan's fate. When a cargo ship carrying 500 refugees from Sri Lanka that reaches the shore of British Columbia who are referred to the "boat people" by news headlines. It stirs a lot of people's opinions on what should happen next. To send them back or to welcome them.

It's a heartbreaking story. Each POV holds its own struggles and it ties the story together well because we're human and this is how we're shaping our world and we all need support at times. A really great book that I recommend if you're interested in reading about these topics or a raw story about fighting for a better future for your children and family. 

